import React from 'react';

class NumberButtons extends React.Component
{
    render() {
        return (
            <div>
                <button type="button" className="btn btn-danger">1</button>
                <button type="button" className="btn btn-danger">2</button>
                <button type="button" className="btn btn-danger">3</button>
                <button type="button" className="btn btn-danger">4</button>
                <button type="button" className="btn btn-danger">5</button>
                <button type="button" className="btn btn-danger">6</button>
                <button type="button" className="btn btn-danger">7</button>
                <button type="button" className="btn btn-danger">8</button>
                <button type="button" className="btn btn-danger">9</button>
            </div>
        );
    }
}

export default NumberButtons;
